import logo from './logo.svg';
import './App.css';
import Sidenav from './components/Sidenav';
import GraphChart from './components/GraphChart';
import PieChart from './components/Pie';
import Table from './components/Table';

function Home() {
  return (
    <div className='main'>
      <GraphChart />
      <PieChart />
      <Table />
    </div>
  )
}

function App() {
  return (
    <div className="App">
      <Sidenav />
      <Home />
    </div>
  );
}

export default App;
